import './App.css';
import Explorer  from "./pages/Users/ExplorerPage"
import { Routes,Route } from 'react-router-dom';
function App() {
  return (
    <Routes>
    <Route path="/" element={<h1>Hey navigate to users</h1>}>HELLO</Route>
     <Route path="/users" element={<Explorer/>}></Route>
      {/* <Route path="/users/:id" element={<Users/>}></Route> */}
    </Routes>
  );
}

export default App;
